def run(protocol):
    strips = protocol.load_labware("corning_96_wellplate_360ul_flat", 1)
    primer_plate = protocol.load_labware("nest_96_wellplate_100ul_pcr_full_skirt", 4)
    p20s = protocol.load_instrument("p20_single_gen2", "left", tip_racks=[protocol.load_labware("opentrons_96_filtertiprack_20ul", i) for i in [3,6]])
    p300s = protocol.load_instrument("p300_single_gen2", "right", tip_racks=[protocol.load_labware("opentrons_96_tiprack_300ul", 5)])

    tube_rack = protocol.load_labware("opentrons_24_tuberack_generic_2ml_screwcap", 2)
    water = tube_rack.wells_by_name()["A1"]
    mm = tube_rack.wells_by_name()["B1"]

    #p20s.transfer(16, water, strips.wells()[-32:])
    #i = 0
    #for row in csv.split("\n"):
    #    row_split = row.split("\t")
    #    p20s.transfer(2, primer_plate.wells_by_name()[row_split[0]], strips.wells()[95-i], new_tip="always")
    #    p20s.transfer(2, primer_plate.wells_by_name()[row_split[1]], strips.wells()[95-i], new_tip="always")
    #    i += 1

    #p300s.transfer(47.5, mm, strips.wells()[:32])
    for i in range(0,32):
        p20s.pick_up_tip()
        p20s.mix(3, 10, strips.wells()[95-i])
        p20s.aspirate(2.5, strips.wells()[95-i])
        p20s.move_to(tube_rack.wells_by_name()["C1"].top())
        p20s.dispense(2.5, strips.wells()[i])
        p20s.drop_tip()
